`Paywalls`: finished localization support (#1362)

### Changes:
- Fixed `PaywallDataExtensions` preview
- Added missing localized strings (discount and default template
strings)
- Added all languages from iOS
- Fixed locale in default paywall (extracting it from
`ApplicationContext`


![image](https://github.com/RevenueCat/purchases-android/assets/685609/9b8c8e10-9ad3-4981-b7aa-c81a20494863)

![image](https://github.com/RevenueCat/purchases-android/assets/685609/04121be2-435c-4339-8316-7da6b7a93be5)

<details>

<summary>For future reference, this was the script I used:</summary>
```swift
import Foundation

// Define the dictionary that maps iOS keys to Android keys
let keyMapping: [String: String] = [
    "Privacy": "privacy",
    "Privacy policy": "privacy_policy",
    "Restore": "restore",
    "Restore purchases": "restore_purchases",
    "Terms": "terms",
    "Terms and conditions": "terms_and_conditions",
    "Annual": "annual",
    "6 Month": "semester",
    "3 Month": "quarter",
    "2 Month": "bimonthly",
    "Monthly": "monthly",
    "Weekly": "weekly",
    "Lifetime": "lifetime",
    "%d%% off": "package_discount",
    "Continue": "continue_cta",
    "Default_offer_details_with_intro_offer": "default_offer_details_with_intro_offer"
]

let iosDirPath = "~/dev/purchases-ios/RevenueCatUI/Resources/"
let androidDirPath = "~/dev/purchases-android/ui/revenuecatui/src/main/res/"

let fileManager = FileManager.default

do {
    let languageFolders = try fileManager
        .contentsOfDirectory(atPath: iosDirPath)
        .filter { $0.contains(".lproj") }

    for languageFolder in languageFolders {
        let iosFilePath = iosDirPath + languageFolder + "/Localizable.strings"
        let androidContainer = androidDirPath + "values-" + languageFolder.replacingOccurrences(of: ".lproj", with: "")
        let androidFilePath = androidContainer + "/strings.xml"

        if !fileManager.fileExists(atPath: androidContainer) {
            print("Creating " + androidContainer)
            try fileManager.createDirectory(atPath: androidContainer, withIntermediateDirectories: true)
        }

        if !fileManager.fileExists(atPath: androidFilePath) {
            print("Creating " + androidFilePath)
            assert(fileManager.createFile(atPath: androidFilePath, contents: nil))
        }

        let iosContent = try String(contentsOfFile: iosFilePath)

        var androidContent = "<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<resources>\n"

        for line in iosContent.split(separator: "\n") {
            let components = line.split(separator: "=")
            if components.count >= 2 {
                let key = components[0].trimmingCharacters(in: .whitespacesAndNewlines).replacingOccurrences(of: "\"", with: "")
                if let androidKey = keyMapping[key] {
                    let value = components[1]
                        .trimmingCharacters(in: .whitespacesAndNewlines)
                        .replacingOccurrences(of: "\"", with: "")
                        .replacingOccurrences(of: ";", with: "")
                        .replacingOccurrences(of: "%d%%", with: "%1$d%")

                    androidContent += "    <string name=\"\(androidKey)\">\(value)</string>\n"
                }
            }
        }

        androidContent += "</resources>\n"

        print("Saving " + androidFilePath)
        try androidContent.write(toFile: androidFilePath, atomically: false, encoding: .utf8)
    }
} catch {
    print("An error occurred: \(error)")
}
```
</details>

